/// Get Material icon character by name, with fallback
pub fn get_icon_or_default(name: &str, default: char) -> char {
    get_icon(name).unwrap_or(default)
}

/// Get Material icon as a String for UI display
pub fn icon_text(name: &str) -> String {
    get_icon(name)
        .map(|c| c.to_string())
        .unwrap_or_else(|| "?".to_string())
}
